import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./components/Home";
import EmailTemplates from "./components/emailtemplates/EmailTemplates";
import CreateRoadMaps from "./components/roadmaps/CreateRoadMaps";
import ViewRoadMaps from "./components/roadmaps/ViewRoadMaps";

const linkStyle = {
  margin: "1rem",
  textDecoration: "none",
  color: "black",
};

function App() {
  return (
    <div>
      <Router>
        <div>
          <nav className="navbar navbar-expand-lg navbar-light bg-light m-2">
            <div>
              <ul className="navbar-nav mr-auto">
                <li className="nav-item active"></li>
                <li className="nav-item" style={{ display: "none" }}>
                  <Link to="/stories/:id">Stories</Link>
                </li>
              </ul>
            </div>
          </nav>
          <Routes>
            <Route path="/createroadmap" element={<CreateRoadMaps />} />
          </Routes>
        </div>
      </Router>
    </div>
  );
}

export default App;
